import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>kaitlyn's site!</div>
      </header>
      <div className="row">
        <div className="column1">column 1!
          <div className="nav-list">
            <div className='nav-item'><a href="example.com"></a></div>
            <div className='nav-item'>about me</div>
            <div className='nav-item'>my projects</div>
            <div className='nav-item'>links</div>
            <div className='nav-item'>fun stuff</div>
          </div>
        </div>
        <div className="column2">column 2!</div>
      </div>
    </div>
  );
}

export default App;
